import React, { useState } from 'react';
import { Enrollment, Student, Course } from '../types';

interface EnrollmentProps {
  enrollments: Enrollment[];
  students: Student[];
  courses: Course[];
  onAddEnrollment: (data: { student: number, course: number }) => Promise<void>;
  onDeleteEnrollment: (id: number) => Promise<void>;
}

export const EnrollmentList: React.FC<EnrollmentProps> = ({ enrollments, students, courses, onAddEnrollment, onDeleteEnrollment }) => {
  const [selectedStudent, setSelectedStudent] = useState('');
  const [selectedCourse, setSelectedCourse] = useState('');

  const handleEnroll = async () => {
    if (!selectedStudent || !selectedCourse) {
        alert("Select both student and course");
        return;
    }
    await onAddEnrollment({ student: Number(selectedStudent), course: Number(selectedCourse) });
    setSelectedStudent('');
    setSelectedCourse('');
  };

  return (
    <div className="bg-white rounded-xl shadow-sm border border-gray-200 overflow-hidden">
      <div className="p-6 border-b border-gray-100 bg-gray-50/50 flex justify-between items-center">
        <h3 className="text-lg font-bold text-gray-800">âœ… Enrollment Records</h3>
        <span className="bg-blue-100 text-blue-800 text-xs font-extrabold px-3 py-1 rounded-full">
          {enrollments.length} RECORDS
        </span>
      </div>
      
      <div className="p-6 bg-blue-50/30 grid grid-cols-1 md:grid-cols-3 gap-4 items-end border-b border-gray-100">
        <div className="space-y-1">
          <label className="text-xs font-semibold text-gray-500 uppercase">Select Student</label>
          <select className="w-full border border-gray-300 p-2 rounded-lg focus:ring-2 focus:ring-blue-500 outline-none bg-white" value={selectedStudent} onChange={e => setSelectedStudent(e.target.value)}>
            <option value="">Choose Student...</option>
            {students.map(s => <option key={s.student_id} value={s.student_id}>{s.first_name} {s.last_name}</option>)}
          </select>
        </div>
        <div className="space-y-1">
          <label className="text-xs font-semibold text-gray-500 uppercase">Select Course</label>
          <select className="w-full border border-gray-300 p-2 rounded-lg focus:ring-2 focus:ring-blue-500 outline-none bg-white" value={selectedCourse} onChange={e => setSelectedCourse(e.target.value)}>
            <option value="">Choose Course...</option>
            {courses.map(c => <option key={c.course_id} value={c.course_id}>{c.course_name}</option>)}
          </select>
        </div>
        <button onClick={handleEnroll} className="bg-blue-600 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-lg transition-all shadow-md">
          Complete Enrollment
        </button>
      </div>

      <div className="overflow-x-auto">
        <table className="w-full text-left">
          <thead className="bg-gray-100 text-gray-600 text-sm uppercase">
            <tr>
              <th className="p-4 font-semibold">Student ID</th>
              <th className="p-4 font-semibold">Course ID</th>
              <th className="p-4 font-semibold text-center">Action</th>
            </tr>
          </thead>
          <tbody className="divide-y divide-gray-100">
            {enrollments.map(e => (
              <tr key={e.enrollment_id} className="hover:bg-red-50/50 transition-colors">
                <td className="p-4 text-gray-700 font-mono">STUDENT #{e.student}</td>
                <td className="p-4 text-gray-700 font-mono">COURSE #{e.course}</td>
                <td className="p-4 text-center">
                  <button onClick={() => onDeleteEnrollment(e.enrollment_id)} className="text-red-500 hover:text-red-700 font-bold text-sm">
                    Unenroll
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default EnrollmentList;
